import React, { useState, useEffect } from 'react';
import { Container, Row, Col, Button, Collapse, Navbar, NavbarToggler, NavbarBrand, Nav, NavItem, NavLink, UncontrolledDropdown, DropdownToggle, DropdownMenu, DropdownItem } from 'reactstrap';
import authService from '../../services/authService'; // Ajusta la ruta según tu estructura
import './municipalidad/administrador.css';
import CrearColegioForm from './CrearColegio';
import VerColegios from './VerColegios';
import CrearDirector from './CrearDirector';
import VerDirectores from './VerDirectores';
import Reportes from '../director/Reportes';

import 'bootstrap/dist/css/bootstrap.min.css'; // Importa Bootstrap CSS

function AdministradorDashboard() {
    const [user, setUser] = useState(null);   
    const [isOpen, setIsOpen] = useState(false); // Estado para colapsar el menú

    const toggle = () => setIsOpen(!isOpen);

    useEffect(() => {
        const fetchUserData = async () => {
            try {
                const userData = await authService.getUserData(); // Función para obtener datos del usuario
                setUser(userData);
            } catch (error) {
                console.error("Error al obtener datos del usuario:", error);
                // Manejar el error, por ejemplo, redirigiendo al login
            }
        };
        fetchUserData();
    }, []); 
    
    const [selectedOption, setSelectedOption] = useState(''); // Guarda la opción seleccionada

    // Función para manejar la selección del menú
    const handleMenuClick = (option) => {
        setSelectedOption(option);
    };

    if (!user) {
        return <div>Cargando...</div>;
    }
 
    return (
        <Container fluid className="p-0">
            <Row noGutters>
                <Col xs="2">
                    <Navbar color="dark" dark expand="md" className="flex-column align-items-start vh-100 p-3">
                        <NavbarBrand href="/">Administrador</NavbarBrand>
                        <NavbarToggler onClick={toggle} className="mb-3"/>
                        <Collapse isOpen={isOpen} navbar>
                            <Nav navbar className="flex-column w-100">
                                <NavItem>
                                    <NavLink href="#" onClick={() => handleMenuClick('colegios')}>Colegios</NavLink>
                                    {selectedOption === 'colegios' && (
                                        <Nav className="flex-column ml-3">
                                            <NavItem>
                                                <NavLink href="#" onClick={() => handleMenuClick('crearColegio')}>Crear Colegio</NavLink>
                                            </NavItem>
                                            <NavItem>
                                                <NavLink href="#" onClick={() => handleMenuClick('verColegios')}>Ver Colegios</NavLink>
                                            </NavItem>
                                        </Nav>
                                    )}
                                </NavItem>
                                <NavItem>
                                    <NavLink href="#" onClick={() => handleMenuClick('directores')}>Directores</NavLink>
                                    {selectedOption === 'directores' && (
                                        <Nav className="flex-column ml-3">
                                            <NavItem>
                                                <NavLink href="#" onClick={() => handleMenuClick('crearDirector')}>Crear Director</NavLink>
                                            </NavItem>
                                            <NavItem>
                                                <NavLink href="#" onClick={() => handleMenuClick('verDirectores')}>Ver Directores</NavLink>
                                            </NavItem>
                                        </Nav>
                                    )}
                                </NavItem>
                                <NavItem>
                                    <NavLink href="#" onClick={() => handleMenuClick('reportes')}>Reportes</NavLink>
                                    {selectedOption === 'reportes' && (
                                        <Nav className="flex-column ml-3">
                                            <NavItem>
                                                <NavLink href="#" onClick={() => handleMenuClick('reportesAsistencias')}>Reportes de Asistencias</NavLink>
                                            </NavItem>
                                            <NavItem>
                                                <NavLink href="#" onClick={() => handleMenuClick('reportesCalificaciones')}>Reportes de Calificaciones</NavLink>
                                            </NavItem>
                                        </Nav>
                                    )}
                                </NavItem>
                            </Nav>
                        </Collapse>
                    </Navbar>
                </Col>

                <Col xs="10" className="p-4">
                    <div className="header mb-4">
                        <h2>Bienvenido, {user.nombre}</h2>
                    </div>     
                    <div className="administrador-content">
                        {selectedOption === 'crearColegio' && <CrearColegioForm />}
                        {selectedOption === 'verColegios' && <VerColegios />}
                        {selectedOption === 'crearDirector' && <CrearDirector />}
                        {selectedOption === 'verDirectores' && <VerDirectores />}
                        {selectedOption === 'reportes' && <Reportes />}
                    </div>
                </Col>
            </Row>
        </Container>
    );
}

export default AdministradorDashboard;
